'use strict';

// Declare app level module which depends on views, and components

var demoApp = angular.module('demoApp',[
  'ngRoute',
  'DemoControllers'
]);

demoApp.config(['$routeProvider',
  function($routeProvider) {
    $routeProvider.
	  when('/list', {
      	templateUrl: 'list_view.html',
        controller: 'listController'
      }).
      when('/map', {
        templateUrl: 'map_view.html',
		controller: 'mapController'
      }).
      when('/map/:targetId', {
        templateUrl: 'mapsingle_view.html',
		controller: 'mapSingleController'
      }).
	   when('/detail/:targetId', {
        templateUrl: 'detail_view.html',
		controller: 'detailController'
      }).
      otherwise({
        redirectTo: '/list'
      });
  }]);


  var demoControllers = angular.module('DemoControllers', []);
  
demoControllers.controller('mapController', ['$scope', function($scope) {
	var myLatlng = new google.maps.LatLng(61.497978, 23.764931); // Tampere

	var mapOptions = {
		zoom: 13,
		center: myLatlng
	}

	$scope.map = new google.maps.Map(document.getElementById('map'), mapOptions);
	
	$scope.markers = [];
	   
		
	var infoWindow = new google.maps.InfoWindow();

	var createMarker = function (light){

		var marker = new google.maps.Marker({
			map: $scope.map,
			position: new google.maps.LatLng(light.geometry.coordinates[1], light.geometry.coordinates[0]),
			title: light.id,
			icon: {
				path: google.maps.SymbolPath.CIRCLE,
				fillColor: 'red',
				fillOpacity: 0.6,
				scale: 5,
				strokeColor: 'black',
				strokeWeight: 1
			}


		});
		marker.content = '<div class="infoWindowContent"><h3>Quick view</h3><hr>id:' + light.id + ' <br>'+light.properties.NIMI+'<br>'+light.properties.TYYPPI+'<hr> <a href="#/detail/'+light.id+'" class="btn btn-primary">Go to detail view</a>';

		google.maps.event.addListener(marker, 'click', function(){
			$scope.map.setCenter(marker.getPosition());
			var finfoWindow = new google.maps.InfoWindow();
			finfoWindow.setContent(marker.content);
			finfoWindow.open($scope.map, marker);

		});

		$scope.markers.push(marker);

	} 

	for (var i = 0; i < lights.length; i++){
		createMarker(lights[i]);
	}

	$scope.taskList = tasks;

	$scope.openInfoWindow = function(e, selectedMarker){
		e.preventDefault();
		google.maps.event.trigger(selectedMarker, 'click');
		return false;
	}
	
}]);

 

